import React from "react";
import AllSvgLogo from "./AllSvgLogo";

function MesLanguages(){
    return(
        <React.Fragment>
            <hr/>
            <section id="MesLanguages">
                <h2>Mes languages</h2>
                <AllSvgLogo/>
        </section>
        </React.Fragment>
    )
}



export default MesLanguages
